import React, { useState } from "react";
import "./index.css";

 const App= () =>{

  const [first,setFirst] =useState("20")

  const chval = () => {
    setFirst(190);
    first++;
    console.log("clicked");
    // setFirst(evnt.target.value);
  }
 
  return(
    <>
    <div>
      <h1>{first}</h1>
      <button onClick={chval}>click</button>
    </div>
    </>
  )
 
 };


   
export default App;
